				.findClassesAndInterfaces(aName, aTag, aNameMatch, aTagMatch);
		for (ClassDescription aClass : aClasses) {
			if (aClass.getJavaClass().isInterface())
				continue;
			return aClass.getJavaClass();
		}
		return null;

		// if (aClasses.size() != 1) {
		// return null;
		// }
		// return aClasses.get(0).getJavaClass();

	}

