		if (aCachedClass != null) {
			if (Object.class.equals(aCachedClass))
				return null;
			else
				return aCachedClass;
		}

		Class retVal = findClass(aProject, aName, aName, aName, aName);
		if (retVal == null) {
			keyToClass.put(aName, Object.class);
