package main.lisp.parser.terms;

import util.annotations.Visible;

public class DisplayableExpression extends BasicExpression {
	
	public DisplayableExpression(SExpression head, SExpression tail) {
		super(head, tail);
	}
	@Override
	public String toString() {
		return isList() ? "(" + toStringAsList() + ")" : toStringAsSExpression();
	}
	@Visible(false)
	@Override
	public boolean isList() {
		return getTail().isList();
	}

	@Override
	public String toStringAsList() {
		StringBuilder ret = new StringBuilder();
		ret.append(getHead());
		if (!(getTail() instanceof NilAtom)) {
			ret.append(" ").append(getTail().toStringAsList());
		}
		return ret.toString();
	}

	@Override
	public String toStringAsSExpression() {
		return "(" + getHead() + " . " + getTail() + ")";
	}

	@Override
	public String toStringAsSExpressionDeep() {
		return "(" + getHead().toStringAsSExpressionDeep() + " . " + getTail().toStringAsSExpressionDeep() + ")";
	}
}

package main.lisp.parser.terms;

import main.lisp.scanner.tokens.Token;
import main.lisp.scanner.tokens.TokenFactory;
import main.lisp.scanner.tokens.TokenType;

public class IntegerAtom extends AbstractAtom<Long> {

	public IntegerAtom(Token token) {
		super(token);
	}

	public IntegerAtom(long l) {
		this(TokenFactory.newInstance(TokenType.INTEGER, Long.toString(l)));
	}

	@Override
	public Long getValue() {
		return Long.parseLong(token.getValue());
	}

	@Override
	public boolean equals(Object o) {
		if (!(o instanceof IntegerAtom)) {
			return false;
		}
		IntegerAtom i = (IntegerAtom)o;
		return i.getValue().equals(getValue());
	}
}

